import re
from collections import Counter


def extract_logs(log_file):
    queue_logs = []
    with open(log_file, 'r') as f:
        for line in f:
            logs = re.findall(r'queue.go:(\d+): (\d+)(.*)', line)
            if len(logs) > 0:
                assert len(logs) == 1
                queue_logs.append(
                    {'line': logs[0][0], 'ts': logs[0][1], 'log': logs[0][2]})
    return queue_logs


